    false,nt"url": null,nt"notes": "World Ocean Atlas 2009 (WOA09) is a set
    of objectively analyzed (1 degree grid) climatological fields of in situ temperature,
    salinity, dissolved oxygen, Apparent Oxygen Utilization (AOU), percent oxygen saturation,
    phosphate, silicate, and nitrate at standard depth levels for annual, seasonal,
    and monthly compositing periods for the World Ocean. It also includes associated
    statistical fields of observed oceanographic profile data interpolated to standard
    depth levels on both 1 degree and 5 degree grids.nnCopies of the World Ocean Atlas
    2009 Figures DVDs are currently available via the NODC Online Store at https://nes.ncdc.noaa.gov/plnes/plsql/olstore.prodspecific?prodnum=6010",nt"license_title":
